import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

var big = true;
function changeSize() {
  big = !big;
  console.log("=========== big: " + big);
}

ReactDOM.render(
  <React.StrictMode>

    <App prop1={"This is the App div..."}  bignotsmall={big}/>
    <button onClick={() => changeSize()}>Alternate Size</button>

  </React.StrictMode>,
  document.getElementById('root')
);
